    data: |
      SELECT DISTINCT NULLIF ( 73, + cor1.col2 - + cor1.col2 ) FROM tab2 AS cor0 CROSS JOIN tab0 AS cor1 GROUP BY cor0.col1, cor1.col2;
  - name: tab0
  - name: tab2

outputs:
  - name: q892.out
    data: |
      73
